import React, { Component } from 'react';
import DestinationCard from './DestinationCard'
import {Link} from 'react-router-dom'
import { Card } from 'semantic-ui-react'

function DestinationContainer(props) {

let handleClick = () => {
  this.props.clearSearch("")
    // props.searchItems("")
}
console.log(props.destinations);
  //
  //   console.log(this.props);
  let destinationCard = props.destination !== undefined ?
    props.destinations.map(destination =>
     <Link onClick={handleClick} key={destination.id} to={`/${destination.id}`}>
       <DestinationCard key={destination.id} destination={destination} routerProps={this.props.routerProps}/></Link>)
         : null

    return (
      <Card.Group className={localStorage.token ? "login-destination-container" : "destination-container"}>
        {destinationCard}
      </Card.Group>
    );


}

export default DestinationContainer;
